import React from 'react';
import './App.css';
import Menubar from './components/layout/menubar'
import "bootstrap/dist/css/bootstrap.min.css" 
import PokemonList from './components/pokemon/pokemonList';
function App() {
  return (
    <div className="App">
      <Menubar/>
      <div className ="container">
      <PokemonList/> 
      </div>
    </div>
  );
}

export default App;
